import React from 'react';
import PropTypes from 'prop-types';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Icon from 'react-icons-kit';
import {star} from 'react-icons-kit/fa/star'
import {starO} from 'react-icons-kit/fa/starO'
//import {codeFork} from 'react-icons-kit/fa/codeFork'
//import {exclamationCircle} from 'react-icons-kit/fa/exclamationCircle'
//import {code} from 'react-icons-kit/fa/code'
//import {ecommerce_dollar} from 'react-icons-kit/linea/ecommerce_dollar'
import {ecommerce_money} from 'react-icons-kit/linea/ecommerce_money'
import {arrows_question} from 'react-icons-kit/linea/arrows_question'
import {music_diapason} from 'react-icons-kit/linea/music_diapason'
import {basic_pencil_ruler} from 'react-icons-kit/linea/basic_pencil_ruler'
import Typography from '@material-ui/core/Typography';

class SimpleCard extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      RepoName: this.props.RepoName,
      RepoAuthor: this.props.RepoAuthor,
      RepoDescription: this.props.RepoDescription,
      Language: this.props.Language,
      Forks: this.props.Forks,
      Issues: this.props.Issues,
      SRCRaised: this.props.SRCRaised,
    };
  };

  handleClickFavourite () {
    this.props.handleStar(this.props.id,this.props.cid);
  };

  render() {
    return (
      <div className="RepoCard">
        <Card elevation={1}>
          <CardContent className="Content">
            <div className="Header">
              <div onClick={()=>this.props.props.history.push(`/source/${this.props.RepoAuthor}/${this.props.RepoName}`)}>
                <Typography className="Name" variant="headline">
                  {this.state.RepoName}
                </Typography>
              </div>
              <div onClick={()=>this.props.props.history.push(`/source/${this.props.RepoAuthor}`)}>
                <Typography variant="subheading" className="Author">{this.state.RepoAuthor}</Typography>
              </div>
              <div className="FavouriteButton">
                <Typography variant="caption" className="StarCount">{this.props.starCount}</Typography>
                {this.props.starred && (<Icon className="StarIcon" size={20} icon={star} onClick={this.handleClickFavourite}/>)}
                {!this.props.starred && (<Icon className="StarIcon" size={20} icon={starO} onClick={this.handleClickFavourite}/>)}
              </div>
            </div>
            <div className="Body">
              <div className="Left">
                <div className="Graphic">
                </div>
                <Typography variant="caption" className="Description">{this.state.RepoDescription}</Typography>
              </div>
              <div className="Right">
                <div className="StatDiv">
                  <Typography variant="caption" className="Stat">{this.state.Language}</Typography>
                  <Icon icon={basic_pencil_ruler} size={18}/>
                </div>
                <div className="StatDiv">
                  <Typography variant="caption" className="Stat">{this.state.Forks}</Typography>
                  <Icon icon={music_diapason} size={18}/>
                </div>
                <div className="StatDiv">
                  <Typography variant="caption" className="Stat">{this.state.Issues}</Typography>
                  <Icon icon={arrows_question} size={18}/>
                </div>
                <div className="StatDiv">
                  <Typography variant="caption" className="Stat">{this.state.SRCRaised}</Typography>
                  <Icon icon={ecommerce_money} size={18}/>
                </div>
              </div>
            </div>
          </CardContent>
        </Card>
      </div>
    );
  }
}

export default SimpleCard;
